class Solution {
    /**
    Input to this function is a string containing multiple groups of nested parentheses. Your goal is to
    separate those group into separate strings and return the list of those.
    Separate groups are balanced (each open brace is properly closed) and not nested within each other
    Ignore any spaces in the input string.
    >>> separate_paren_groups("( ) (( )) (( )( ))")
    ["()", "(())", "(()())"]
     */
    public List<String> separate_paren_groups(String paren_string) {
        List<String> result = new ArrayList<>();
        Stack<Character> stack = new Stack<>();
        StringBuilder current_group = new StringBuilder();

        // Remove spaces from the input string
        paren_string = paren_string.replace(" ", "");

        for (char ch : paren_string.toCharArray()) {
            if (ch == '(') {
                stack.push(ch);
                current_group.append(ch);
            } else if (ch == ')') {
                stack.pop();
                current_group.append(ch);

                // If the stack is empty, it means we have completed a group
                if (stack.isEmpty()) {
                    result.add(current_group.toString());
                    current_group = new StringBuilder();  // Reset for next group
                }
            }
        }

        return result;
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.separate_paren_groups("(()()) ((())) () ((())()())").equals(Arrays.asList(
                        "(()())", "((()))", "()", "((())()())"
                )),
                s.separate_paren_groups("() (()) ((())) (((())))").equals(Arrays.asList(
                        "()", "(())", "((()))", "(((())))"
                )),
                s.separate_paren_groups("(()(())((())))").equals(Arrays.asList(
                        "(()(())((())))"
                )),
                s.separate_paren_groups("( ) (( )) (( )( ))").equals(Arrays.asList("()", "(())", "(()())"))
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
}

