class Solution {
    /**
     * Filter an input list of strings only for ones that contain given substring
     * >>> filter_by_substring(List.of(), "a")
     * []
     * >>> filter_by_substring(Arrays.asList("abc", "bacd", "cde", "array"), "a")
     * ["abc", "bacd", "array"]
     */
    public List<String> filter_by_substring(List<String> strings, String substring) {
        // Create a new list to store the filtered results
        List<String> result = new ArrayList<>();

        // Iterate over each string in the input list
        for (String s : strings) {
            // Check if the substring is present in the current string
            if (s.contains(substring)) {
                // Add the string to the result list if it contains the substring
                result.add(s);
            }
        }

        return result;
    }
}

