class Solution {
    /**
     * Input are two strings a and b consisting only of 1s and 0s.
     * Perform binary XOR on these inputs and return result also as a string.
     * >>> string_xor("010", "110")
     * "100"
     */
    public String string_xor(String a, String b) {
        // Determine the maximum length of the two strings
        int max_len = Math.max(a.length(), b.length());

        // Pad both strings with leading zeros to ensure they are of equal length
        a = padStringWithZeros(a, max_len);
        b = padStringWithZeros(b, max_len);

        // Initialize a StringBuilder to store the result
        StringBuilder result = new StringBuilder();

        // Perform bitwise XOR operation on each bit position
        for (int i = 0; i < max_len; i++) {
            if (a.charAt(i) == b.charAt(i)) {
                result.append('0');
            } else {
                result.append('1');
            }
        }

        return result.toString();
    }

    // Helper method to pad a string with leading zeros
    private String padStringWithZeros(String str, int length) {
        StringBuilder paddedStr = new StringBuilder(str);
        while (paddedStr.length() < length) {
            paddedStr.insert(0, '0');
        }
        return paddedStr.toString();
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                Objects.equals(s.string_xor("111000", "101010"), "010010"),
                Objects.equals(s.string_xor("1", "1"), "0"),
                Objects.equals(s.string_xor("0101", "0000"), "0101")
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
}

