class Solution {
    /**
     * Out of list of strings, return the longest one. Return the first one in case of multiple
     * strings of the same length. Return Optional.empty() in case the input list is empty.
     * 
     * Examples:
     * >>> longest(List.of())
     * Optional.empty()
     * 
     * >>> longest(Arrays.asList("a", "b", "c"))
     * Optional[a]
     * 
     * >>> longest(Arrays.asList("a", "bb", "ccc"))
     * Optional[ccc]
     */
    public Optional<String> longest(List<String> strings) {
        if (strings.isEmpty()) {
            return Optional.empty();
        }

        int maxLength = 0;
        String longestString = "";

        for (String string : strings) {
            if (string.length() > maxLength) {
                maxLength = string.length();
                longestString = string;
            }
        }

        return Optional.of(longestString);
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
