class Solution {
    /**
     Evaluates polynomial with coefficients xs at point x.
     return xs[0] + xs[1] * x + xs[2] * x^2 + .... xs[n] * x^n
      */
    public double poly(List<Double> xs, double x) {
        double result = 0;
        for (int i = 0; i < xs.size(); i++) {
            result += xs.get(i) * Math.pow(x, i);
        }
        return result;
    }

    /**
     xs are coefficients of a polynomial.
     find_zero finds x such that poly(x) = 0.
     find_zero returns only one zero point, even if there are many.
     Moreover, find_zero only takes list xs having an even number of coefficients
     and guarantees a solution with the largest non-zero coefficient.
      */
    public double find_zero(List<Double> xs) {
        // Implementing a simple root-finding algorithm, such as the bisection method.
        return bisect(xs, -10, 10, 1e-6);
    }

    private double bisect(List<Double> xs, double a, double b, double tol) {
        DoubleUnaryOperator f = t -> poly(xs, t);

        if (f.applyAsDouble(a) * f.applyAsDouble(b) > 0) {
            throw new IllegalArgumentException("f(a) and f(b) must have opposite signs");
        }

        while ((b - a) / 2.0 > tol) {
            double c = (a + b) / 2.0;
            double fc = f.applyAsDouble(c);
            if (fc == 0 || (b - a) / 2.0 < tol) {
                return c;
            } else if (f.applyAsDouble(a) * fc < 0) {
                b = c;
            } else {
                a = c;
            }
        }
        return (a + b) / 2.0;
    }

    @FunctionalInterface
    private interface DoubleUnaryOperator {
        double applyAsDouble(double operand);
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        Random rand = new Random(42);
        for (int i = 0; i < 100; i++) {
            int ncoeff = 2 * (rand.nextInt(3) + 1);
            List<Double> coeffs = new ArrayList<>();
            for (int j = 0; j < ncoeff; j++) {
                int coeff = rand.nextInt(20) - 10;
                if (coeff == 0) {
                    coeff = 1;
                }
                coeffs.add((double) coeff);
            }
            double solution = s.find_zero(coeffs);
            if (Math.abs(s.poly(coeffs, solution)) > 1e-4) {
                throw new AssertionError();
            }
        }
    }
}

