class Solution {
    /**
     * This function takes a list l and returns a list l' such that
     * l' is identical to l in the indices that are not divisible by three, while its values at the indices that are divisible by three
     * are equal to the values of the corresponding indices of l, but sorted in ascending order.
     *
     * @param l The input list of integers.
     * @return A new list where elements at indices divisible by three are sorted in ascending order.
     */
    public List<Integer> sort_third(List<Integer> l) {
        // Extract values at indices divisible by 3
        List<Integer> thirdIndicesValues = new ArrayList<>();
        for (int i = 0; i < l.size(); i++) {
            if ((i + 1) % 3 == 0) {
                thirdIndicesValues.add(l.get(i));
            }
        }

        // Sort the extracted values
        Collections.sort(thirdIndicesValues);

        // Create and populate the result list
        List<Integer> result = new ArrayList<>();
        int sortedIndex = 0;
        for (int i = 0; i < l.size(); i++) {
            if ((i + 1) % 3 == 0) {
                result.add(thirdIndicesValues.get(sortedIndex++));
            } else {
                result.add(l.get(i));
            }
        }

        return result;
    }
}

