class Solution {
    public int prime_fib(int n) {
        return findNthPrimeFibonacci(n);
    }

    private boolean isPrime(int num) {
        if (num <= 1) {
            return false;
        }
        for (int i = 2; i * i <= num; i++) {
            if (num % i == 0) {
                return false;
            }
        }
        return true;
    }

    private int findNthPrimeFibonacci(int n) {
        int a = 0, b = 1;
        int count = 0;

        while (true) {
            int fibNum = a + b;
            if (isPrime(fibNum)) {
                count++;
                if (count == n) {
                    return fibNum;
                }
            }
            a = b;
            b = fibNum;
        }
    }

    // Test cases
    public static void main(String[] args) {
        Solution solution = new Solution();
        System.out.println(solution.prime_fib(1));  // Output: 2
        System.out.println(solution.prime_fib(2));  // Output: 3
        System.out.println(solution.prime_fib(3));  // Output: 5
        System.out.println(solution.prime_fib(4));  // Output: 13
        System.out.println(solution.prime_fib(5));  // Output: 89
    }
}

