class Solution {
    /**
     * Return 2^n modulo p (be aware of numerics).
     */
    public int modp(int n, int p) {
        // Use BigInteger for handling large numbers and efficient modular exponentiation.
        BigInteger base = new BigInteger("2");
        BigInteger exponent = BigInteger.valueOf(n);
        BigInteger modulus = BigInteger.valueOf(p);

        // Calculate 2^n modulo p using the modPow method of BigInteger.
        BigInteger result = base.modPow(exponent, modulus);

        // Convert the result to an int and return it.
        return result.intValue();
    }
}

