    >>> median(Arrays.asList(3, 1, 2, 4, 5))
    3
    >>> median(Arrays.asList(-10, 4, 6, 1000, 10, 20))
    8.0
     */
    public double median(List<Integer> l) {
        // Sort the list
        Collections.sort(l);

        int n = l.size();
        if (n % 2 == 1) {
            return l.get(n / 2); // Return the middle element for odd length
        } else {
            int mid_left = l.get((n - 1) / 2);
            int mid_right = l.get(n / 2);
            return (mid_left + mid_right) / 2.0; // Return the average of two middle elements for even length
        }
    }
}

