class Solution {
    /**
    Return the largest prime factor of n. Assume n > 1 and is not a prime.
    >>> largest_prime_factor(13195)
    29
    >>> largest_prime_factor(2048)
    2
     */
    public int largest_prime_factor(int n) {
        int i = 2;
        int lastPrime = -1; // Initialize to a value that won't be a valid prime factor

        while (i * i <= n) {
            if (n % i == 0) {
                lastPrime = i;
                while (n % i == 0) {
                    n /= i;
                }
            }
            i += 1;
        }

        // After the loop, either n is a prime number or it's already been divided out
        return n > lastPrime ? n : lastPrime;
    }
}

