class Solution {
    /**
     In this task, you will be given a string that represents a number of apples and oranges
     that are distributed in a basket of fruit. This basket contains apples, oranges, and mango fruits.
     Given the string that represents the total number of the oranges and apples and an integer that represent 
     the total number of the fruits in the basket return the number of the mango fruits in the basket.
     for example:
     fruit_distribution("5 apples and 6 oranges", 19) -> 19 - 5 - 6 = 8
     fruit_distribution("0 apples and 1 oranges",3) -> 3 - 0 - 1 = 2
     fruit_distribution("2 apples and 3 oranges", 100) -> 100 - 2 - 3 = 95
     fruit_distribution("100 apples and 1 oranges",120) -> 120 - 100 - 1 = 19
      */
    public int fruit_distribution(String s, int n) {
        // Use regular expression to find all occurrences of digits in the string
        Pattern pattern = Pattern.compile("\\d+");
        Matcher matcher = pattern.matcher(s);

        int apples = 0;
        int oranges = 0;

        if (matcher.find()) {
            apples = Integer.parseInt(matcher.group());
        }
        if (matcher.find()) {
            oranges = Integer.parseInt(matcher.group());
        }

        // Calculate the number of mangoes
        int mangoes = n - (apples + oranges);

        return mangoes;
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.fruit_distribution("5 apples and 6 oranges",19) == 8,
                s.fruit_distribution("5 apples and 6 oranges",21) == 10,
                s.fruit_distribution("0 apples and 1 oranges",3) == 2,
                s.fruit_distribution("1 apples and 0 oranges",3) == 2,
                s.fruit_distribution("2 apples and 3 oranges",100) == 95,
                s.fruit_distribution("2 apples and 3 oranges",5) == 0,
                s.fruit_distribution("1 apples and 100 oranges",120) == 19
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
}

