class Solution {
    /**
     * Circular shift the digits of the integer x, shift the digits right by shift
     * and return the result as a string.
     * If shift > number of digits, return digits reversed.
     * >>> circular_shift(12, 1)
     * "21"
     * >>> circular_shift(12, 2)
     * "12"
     */
    public String circular_shift(int x, int shift) {
        // Convert integer to string
        String numStr = Integer.toString(x);

        // Get the number of digits in the number
        int numDigits = numStr.length();

        // If shift is greater than or equal to the number of digits, return reversed string
        if (shift >= numDigits) {
            return new StringBuilder(numStr).reverse().toString();
        }

        // Compute effective shift value
        shift %= numDigits;

        // Perform circular shift
        String shiftedPart = numStr.substring(numDigits - shift);
        String nonShiftedPart = numStr.substring(0, numDigits - shift);

        // Concatenate the results to form the final string
        return shiftedPart + nonShiftedPart;
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.circular_shift(100, 2).equals("001"),
                s.circular_shift(12, 2).equals("12"),
                s.circular_shift(97, 8).equals("79"),
                s.circular_shift(12, 1).equals("21"),
                s.circular_shift(11, 101).equals("11")
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
}

