class Solution {
    /**
     * Given list of integers, return list in strange order.
     * Strange sorting, is when you start with the minimum value,
     * then maximum of the remaining integers, then minimum and so on.
     *
     * Examples:
     * strange_sort_list(Arrays.asList(1, 2, 3, 4)) == Arrays.asList(1, 4, 2, 3)
     * strange_sort_list(Arrays.asList(5, 5, 5, 5)) == Arrays.asList(5, 5, 5, 5)
     * strange_sort_list(Arrays.asList()) == Arrays.asList()
     */
    public List<Integer> strange_sort_list(List<Integer> lst) {
        List<Integer> result = new ArrayList<>();
        while (!lst.isEmpty()) {
            // Append minimum value from remaining elements
            int minVal = Collections.min(lst);
            result.add(minVal);
            lst.remove(Integer.valueOf(minVal));

            if (lst.isEmpty()) {
                break;
            }

            // Append maximum value from remaining elements
            int maxVal = Collections.max(lst);
            result.add(maxVal);
            lst.remove(Integer.valueOf(maxVal));
        }

        return result;
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.strange_sort_list(new ArrayList<>(Arrays.asList(1, 2, 3, 4))).equals(Arrays.asList(1, 4, 2, 3)),
                s.strange_sort_list(new ArrayList<>(Arrays.asList(5, 6, 7, 8, 9))).equals(Arrays.asList(5, 9, 6, 8, 7)),
                s.strange_sort_list(new ArrayList<>(Arrays.asList(1, 2, 3, 4, 5))).equals(Arrays.asList(1, 5, 2, 4, 3)),
                s.strange_sort_list(new ArrayList<>(Arrays.asList(5, 6, 7, 8, 9, 1))).equals(Arrays.asList(1, 9, 5, 8, 6, 7)),
                s.strange_sort_list(new ArrayList<>(Arrays.asList(5, 5, 5, 5))).equals(Arrays.asList(5, 5, 5, 5)),
                s.strange_sort_list(new ArrayList<>(List.of())).equals(List.of()),
                s.strange_sort_list(new ArrayList<>(Arrays.asList(1, 2, 3, 4, 5, 6, 7, 8))).equals(Arrays.asList(1, 8, 2, 7, 3, 6, 4, 5)),
                s.strange_sort_list(new ArrayList<>(Arrays.asList(0, 2, 2, 2, 5, 5, -5, -5))).equals(Arrays.asList(-5, 5, -5, 5, 0, 2, 2, 2)),
                s.strange_sort_list(new ArrayList<>(List.of(111111))).equals(List.of(111111))
        );
        if (correct.contains(false)) {
